import React, { useState } from 'react'

function testHooks() {
  const [techs, setTech] = useState(['ReactJS', 'React native'])

  return (
    <ul>
      {techs.map((tech) => (
        <li key={tech}>{tech}</li>
      ))}
    </ul>
  )
}

export default testHooks
